    "treasurer" : "Schatzmeister",
    "Annular insurance fees for %d" : "Versicherungs-Jahresbeitrag %d",
    "Dear %s," : "Liebe/Lieber %s,",
    "this letter informs you about the details of the instrument-insurances\nwe are maintaining for you on your behalf. This letter is\nmachine-generated; in case of any inconsistencies or other questions\nplease contact us as soon as possible in order to avoid any further\nmisunderstandings. This letter is sent to you by traditional mail for\ndata-security reason. Please keep a copy of this letter in a safe\nplace; further insurance-charts will only be sent automatically to you\nif something changes. Of course, you may request this information about\nyour insured items at any time. Just ask." : "dieses Schreiben informiert Dich über die Instrumenten-Versicherungen,\ndie wir für Dich in Deinem Auftrag verwalten. Dieser Brief wird\nautomatisch erzeugt; bitte kontaktiere uns so schnell wie möglich,\nfalls es Unstimmigkeiten oder andere Probleme gibt, damit weitere\nMissverständnisse vermieden werden können. Aus Datenschutzgründen\nverschicken wir diese Aufstellung ausschließlich auf herkömmlichen\nPostweg. Bitte bewahre dieses Schreiben auf; weitere Aufstellungen\nverschicken wir automatisch nur dann, wenn sich an der Versicherung\netwas ändern sollte. Selbstverständlich aber kannst Du auf Nachfrage\njederzeit von uns eine Aufstellung Deiner versicherten Gegenstände\nbekommen.",
    "Insured Person: %s" : "Versicherte Person: %s",
    "Vendor" : "Anbieter",
    "Object" : "Gegenstand",
    "Fee" : "Beitrag",
    "Sub-totals (excluding taxes)" : "Zwischensumme (ohne Steuern)",
    "Start and end of the regular insurance period is as\nindicated in the column \"Due\" in the following table. The actual start of\nthe insurance for the particular item is as indicated in the column \"Start\".\nIn the first year, we charge a fraction of the regular annual fee for the\ninsurance period between \"Start\" and \"Due\" as indicated in the column \"Factor\"" : "In der folgenden Tabelle gibt die Spalte \"Fälligkeit\" den Beginn und\ndas Ende des regulären Versicherungsjahrs der Sammelversicherung\nan. Die Spalte \"Beginn\" ist das Datum des Beginns der Versicherung für\nden einzelnen Gegenstand. Für neu versicherte Gegenstände wird die\nZeit zwischen \"Beginn\" und \"Fälligkeit\" als Anteil am Jahresbeitrag\neinmalig in Rechnung gestellt, Spalte \"Faktor\".",
    "Due" : "Fälligkeit",
    "Start" : "Beginn",
    "Factor" : "Faktor",
    "Sum of corrections (excluding taxes)" : "Summe der Korrekturen (ohne Steuern)",
    "Total Insurance Fees" : "Gesamtversicherungsbeitrag",
    "Regular annual insurance fee for all insured items of all musicians" : "Regulärer Jahresbeitrag für alle versicherten Gegenstände",
    "Annual amount excluding taxes:" : "Jahresbeitrag ohne Steuern:",
    "%0.2f %% insurance taxes:" : "%0.2f %% Versicherungssteuer:",
    "Total amount to pay:" : "Rechnungsbetrag:",
    "The amount to pay for newly insured items may be larger than the regular annual\nfee as it may contain the fees for the time between the start of the insurance for\nthe individual items and the regular due-date, as indicated in the tables above.\nThe actual total amount, including fees for \"partial\" insurance perdiods is as follows:" : "Der Beitrag für neu versicherte Gegenstände kann beim ersten Mal höher\nausfallen als der reguläre Jahresbeitrag, da er den Zeitraum zwischen\nDeckungsbeginn für den einzelnen Gegenstand und dem normalen\nFälligkeitstermin für die Sammelversicherung einschließt, siehe\noben. Der aktuelle Gesamtbeitrag, einschließlich dieser Korrekturen,\nbeläuft sich auf:",
    "Total amount excluding taxes:" : "Gesamtbetrag ohne Steuern:",
    "You have granted us a debit-mandate. The total amount due will be debited from your bank-account, no further action from your side is required. We will inform you by email about the date of the debit at least 14 days in advance of the bank transaction." : "Du hast uns ein Lastschrift-Mandat erteilt, der oben genannte\nGesamtbetrag wird von Deinem Konto eingezogen. Wir informieren Dich\nwenigstens 14 Tage im voraus per Email über das genaue Datum der\nKontobelastung.",
