    "Raise priority" : "Darstellungspriorität erhöhen",
    "Lower priority" : "Darstellungspriorität vermindern.",
    "It may be that you simply have to log-off and log-in again because your login-session has timed out. Otherwise the following instructions apply:\n<p>\nSeveral basic configuraton options are missing. Please follow they\ninstructions below. If this is a new installation then you will\nprobably also have to adjust several other settings in the\nconfiguration menu (click on the gear-symbol in the top-right\ncorner). You need to have the role of a group-administrator to do\nso. You may want to configure your language preferences." : "Möglicherweise müssen Sie sich einfach ab- und wieder anmelden weil\nIhre Sitzung abgelaufen ist. Ansonsten ist das Folgende zu beachten:\n<p>\nEtliche grundlegende Einstellungen fehlen. Bitte folgen Sie den\nAnweisungen unten. Falls es sich um eine Neuinstallation handelt,\nwerden Sie vermutlich auch noch Etliches im Konfigurationsmenü\neinstellen wollen (dazu auf das Zahnrad oben rechts klicken). Dazu\nmüssen Sie als Gruppenadministrator registriert sein. Vermutlich\nmöchten Sie auch vorher Ihre bevorzugte Sprache konfigurieren.",
    "You need to specify a name for the orchestra.  Please click as\ngroup-administrator on the gear-symbol in the top-right corner and\nspecify a short-hand name for the orchestra in the\n`Administration'-tab. This is just a tag to provide defaults for\nuser-ids and folders; it should be a short one-word identifier." : "Sie müssen eine Kurzbezeichnung für das Orchester angeben. Als Gruppen-Administrator können Sie dazu auf das Zahnrad-Symbol oben rechts klicken und im `Verwaltung'-Reiter diese Einstellung vornehmen. Der Name ist nur eine Kurzbezeichnung, typischerweise ein einzelnes, kurzes Wort. ",
    "You need to create a dedicatd user group.\nYou have to log-in as administrator to do so." : "Sie müssen die Orchester-Gruppe erstelllen. Loggen Sie sich dazu bitte mit einem Administrator-Account ein.",
    "You need to create a dummy-user which owns all shared resources\n(calendars, files etc.). You need to be a group-admin for the\norchestra user group `%s' to do so. You can create the share-owner\nuid by setting the respective field in the application settings menu\n(click as group-admin on the gear-symbol in the top-right corner and\nchoose the `Sharing'-tab)." : "Sie müssen eine Benutzer-`Strohpuppe' anlegen, der alle gemeinsamen Resourcen gehören. Als Gruppen-Administrator für die Orchestergruppe `%s' können Sie dazu auf das Zahnrad-Symbol oben rechts klicken und im `Sharing'-Reiter diese Einstellung vornehmen.",
    "You need to create a dedicated shared folder shared among the\nuser-group `%s'. You can do so through the respective web-form in the\napplication settings windows accessible through the gear-symbol in the\ntop-right corner. Click on the symbol and choose the `Sharing'-tab in\nthe settings-window. You need to be a group-admin, otherwise the\napplication settings are not visible for you." : "Sie müssen einen Ordner angeben, der von allen Mitgliedern der\nOrchester-Gruppe `%s' zum Datenaustausch verwendet werden kann. Als\nGruppenadministrator können Sie dazu auf das Zahnradsymbol oben rechts\nklicken und die entsprechenden Einstellungen im `Sharing'-Reiter\nvornehmen.",
    "blah" : "blah",
    "You need to configure the database access. You can do so through the\nrespective web-form in the application settings windows accessible\nthrough the gear-symbol in the upper left corner. Click on the\ngear-symbol and choose the `Administration'-tab.You need to be a\ngroup-admin, otherwise the application settings are not visible for\nyou." : "Sie müssen den Datenbank-Zugriff konfigurieren. Als\nGruppen-Administrator können Sie dazu auf das Zahnrad-Symbol oben\nrechts klicken und die erforderlichen Einstellungen im\n`Verwaltung'-Reiter vornehmen.",
    "You may want to set an encryption key for encrypting configuration\nvalues and (in the future) sensitive data in the members- and project\ndatabase.  You can do so through the respective web-form in the\napplication settings windows accessible through the gear-symbol in the\nupper left corner. You need to be a group-admin, otherwise the\napplication settings are not visible for you. Note also that after\ninstalling a non-empty encryption key each user has to log-out and\nlog-in again in order to be able to access the encrypted values." : "Es ist sicher eine gute Idee, Verschlüsselung für die Konfigurations-Daten und (in späteren Programmversionen) für sensible Musiker-Daten einzuschalten. Dazu können Sie als Gruppenadministrator auf das Zahnrad-Symbol oben rechts klicken und im `Verwaltung'-Reiter einen Codier-Schlüssel angeben. Mitglieder erhalten danach erst wieder Zugriff auf die Daten, nachdem ebenfalls im `Verwaltung'-Reiter der Knopf `Schlüssel publiczieren' aktiviert wurde.",
    "Test again" : "Erneut testen",
